import React from "react";
import { Link, useNavigate } from "react-router-dom";

const BookList = () => {
  return (
    <div className="section book-liksst">
      <div className="page-title">Book List</div>
      <link>
        http://openapi.naver.com/l?AAAC3LSwqDMBSF4dXcDCV6YxsHGfiog6JIV1A0SYloGpumQnffFIQz+DnwvT7afwVcaigRqvofvIKiIcbrhzAhbIAlZG3c5NySPMdd+0Q6exxqOuKudBjnNdlMFO00K8AmpRzZKackiJSdGc8ZxZzSglix3vqhG6KVKPcis0vXX+k+vqXM2BLpDzHjEYWYAAAA
      </link>

      <image>
        http://bookthumb.phinf.naver.net/cover/108/346/10834650.jpg?type=m1&udate=20160902
      </image>

      <Link to="/book/bookadd" className="btn-primary">
        글쓰기
      </Link>
    </div>
  );
};

export default BookList;
